import {
  propertiesData,
  getPropertyById,
} from "../components/helpers/api-util";

const DetailsPage = () => {
  const history = useParams();

  const property = getPropertyById(history.id).then(data => console.log(data));

  const getPropery = async () => {
    const found = await getPropertyById(history.id);
    const data = await found.data
  }

  return <PropertyDetails />;
};

